import React, { useEffect, useState} from "react";
import { useParams } from "react-router-dom";
import axios from 'axios';

function PatientsDetail () {
    let { id } = useParams();
    const [patientObject, setPatientObject] = useState({});
    const [glucoses, setGlucoses] = useState([]);
    const [cholesterol, setCholesterol] =useState([]);

    useEffect(() => {
        axios.get(`http://localhost:3001/patientsinfo/byId/${id}`).then((response) => {
            setPatientObject(response.data);
            console.log(response.data);
    }); 
        axios.get(`http://localhost:3001/bloodsugarlevel/${id}`).then((response) => {
            setGlucoses(response.data);
            console.log(response.data);
    }); 
        axios.get(`http://localhost:3001/cholesterollevel/${id}`).then((response) => {
            setCholesterol(response.data);
            console.log(response.data);
    }); 

}, []);


    return(
        <section>
            <div>
                {patientObject.firstName} , {patientObject.lastName}, {glucoses.bloodSugarLevel}
            </div>
            <div>
                {glucoses.map((glucose, key) => {
                    return(
                    <div>
                        <div
                        className='p-10'
                        > {glucose.bloodSugarLevel}
                        </div>
                    </div>
                    )
                })}
            </div>
            <div>
                {cholesterols.map((cholesterol, key) => {
                    return(
                    <div>
                        <div
                        className='p-10'
                        > {cholesterol.bloodSugarLevel}
                        </div>
                    </div>
                    )
                })}
            </div>
            <h1>
                Add Info
            </h1>
        </section>
    )
}

export default PatientsDetail
